    7, 2008 letter .   1. The description Micro targeting expense has been clarified
    as Surveys             2. On Schedule B  Postage- BRE Account has been changed
    to Postage -BRE Acct Fundraising and Postage Meter Postage has been changed to
    Postage Meter - Administrative.  There was also a payment to the US Postal Service
    listed on 21(b) for 16,435.29 that was postage for a non federal election mailing
    - that payment has been moved to line 29.                                                                The
    Fundraising expenses did not promote, support or oppose a candidate for the 2008
    Federal Election.  Kentucky was one of those States that had State elections in
    2007 - several of our staff members worked solely on State Activities that their
    payroll is reported on line 29"
